import React from 'react';
import '../App.css';
import LeftSideProfile from './LeftSideProfile';

function Home() {
  return (
    <div style={{ display: 'flex', width: '100%' }}>

    <LeftSideProfile />

    <div style={{ flex: '2' }}> {/* Middle content */}
        <h2>Projects</h2>


      </div>
      <div style={{ flex: '1' }}> {/* Right side empty space */}</div>
    </div>
  );
}

export default Home;
